PackNGo.controller('SamplesCtrl',function($scope,$sce){
	var pdfBase64="";
	var bytePDFCharacters = atob(pdfBase64);
	var bytePDFNumbers = new Array(bytePDFCharacters.length);
	for (var i = 0; i < bytePDFCharacters.length; i++) {
		bytePDFNumbers[i] = bytePDFCharacters.charCodeAt(i);
	}
	var bytePDFArray = new Uint8Array(bytePDFNumbers);
	
	var myblob = new Blob([bytePDFArray], {
	    type: 'application/pdf'});
	var fileURL = URL.createObjectURL(myblob);
	$scope.content = $sce.trustAsResourceUrl(fileURL);
	
});
